// Implement routes by fetching from some API
import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getRoutes } from "../../store/actions/routeActions";
import FindRoutesItem from "./FindRoutesItem";

const FindRoutes = ({ route, getRoutes }) => {
  // let route = fetch("https://api.myjson.com/bins/yqyge")
  //   .then(res => res.json())
  //   .then(data => {
  //     return JSON.stringify(data);
  //   });
  // console.log(route);
  useEffect(() => {
    getRoutes();
  });
  // console.log(routes.id);
  return (
    <div>
      <FindRoutesItem route={route} />
    </div>
  );
};

const mapStateToProps = state => {
  return {
    route: state.route
  };
};

export default connect(mapStateToProps, { getRoutes })(FindRoutes);
